import React from "react";
import { Router } from "./router/Router";
import { ChakraProvider } from "@chakra-ui/react";
import { RecoilRoot } from "recoil";

import { Theme } from "./theme/Theme";

export const App = () => {
  return (
    <ChakraProvider theme={Theme}>
      <RecoilRoot>
        <Router />
      </RecoilRoot>
    </ChakraProvider>
  );
};
